"   <div class=\"block pha drugH1Div\" id=\"F132909\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Mechanism of Action",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Inhibits protein synthesis in susceptible bacteria by binding to 30S ribosomal subunits",
"    </p>",
"   </div>",
"   <div class=\"block phk drugH1Div\" id=\"F132929\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Pharmacodynamics/Kinetics",
"    </span>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Absorption:",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;\">",
"     I.M.: Rapid",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;\">",
"     Oral: Poorly absorbed",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Distribution: V",
"     <sub>",
"      d",
"     </sub>",
"     : 0.25 L/kg; primarily into extracellular fluid (highly hydrophilic); penetrates blood-brain barrier when meninges inflamed",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Relative diffusion of antimicrobial agents from blood into CSF: Good only with inflammation (exceeds usual MICs)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     CSF:blood level ratio: Normal meninges: 10% to 20%; Inflamed meninges: 15% to 24%",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Protein-binding: 0% to 11%",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Half-life elimination (renal function and age dependent):",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Infants: Low birth weight (1-3 days): 7-9 hours; Full-term &gt;7 days: 4-5 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Children: 1.6-2.5 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Adults: Normal renal function: 1.4-2.3 hours; Anuria/end-stage renal disease: 28-86 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Time to peak, serum: I.M.: 45-120 minutes",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Excretion: Urine (94% to 98%)",
"    </p>",
"   </div>",
